function Sponsors() {
    return (
        <div id="sponsors" className="section">
            <div className="container">
            <h1 className="text-center">Sponsors</h1>
            <h2>Our generous sponsors and partners.</h2>
            <h2>Want to sponsor us? Check out our <a href="https://drive.google.com/file/d/1yhuxijjjOdvd7furPhY_yatJd0xVVd7Q/view?usp=share_link" style={{color:"white"}}>Sponsorship Package</a> and email us at <a href="mailto:hackinfo@utra.ca" style={{color:"white"}}>hackinfo@utra.ca</a>!</h2>
            </div>
        </div>
    );
} 

export default Sponsors;
